import React, { useState, useEffect } from 'react';
import UserService from '../services/UserService';

const ViewUserComponent = (props) => {
  const [task, setTask] = useState({
    id: '',
    taskName: '',
    startDate: '',
    endDate: '',
    taskStatus: '',
    totalEffortReq: '',
  });

  useEffect(() => {
    UserService.getAllTasks(props.id).then((res) => {
      setTask(res.data);
    });
  }, [props.id]);

  return (
    <div>
      <br></br>
      <div className="card col-md-6 offset-md-3">
        <h3 className="text-center">Task Details</h3>
        <div className="card-body">
          <div className="row">
            <label>User Id</label>
            <div> {task.id}</div>
          </div>
          <div className="row">
            <label>User TaskName</label>
            <div> {task.taskName}</div>
          </div>
          <div className="row">
            <label>User StartDate </label>
            <div> {task.startDate}</div>
          </div>
          <div className="row">
            <label>User EndDate </label>
            <div> {task.endDate}</div>
          </div>
          <div className="row">
            <label>User TaskStatus </label>
            <div> {task.taskStatus}</div>
          </div>
          <div className="row">
            <label>User TotalEffortReq </label>
            <div> {task.totalEffortReq}</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ViewUserComponent;
